<script setup>
import { ref, onMounted } from 'vue'

// Fonction de calcul aléatoire descouleurs type rgba
// Non exportable, car utilisée par une fonction interne
const couleur = (max) => {
    return Math.round(Math.random() * (max), 0);
}

const aleatoire = () => {
    let bgColor = []
        // On calcule la couleur du secteur
        let c1 = couleur(255)
        let c2 = couleur(255)
        let c3 = couleur(255)
        let tr = 1
        // Couleur avec transparence
        let color = 'rgba(' + [c1, c2, c3, tr].join(',') + ")"
        bgColor.push(color)
    
    return [bgColor]
}
const couleur1 = ref()

const selectMode = () => {
            let bgColor = null 
            // Couleurs aléatoires
            bgColor = aleatoire()
            couleur1.value = bgColor
            return[couleur1]
            }
onMounted( () => {
    selectMode()
}
)


</script>

